pi_index==\"dns\"){\n      get_dns()\n    }else{\n      get_index()\n    }\n})\n\nlanguage_dir = \"\"\n\n$.fn.chk_userlanguage = function() {\n    /* check if <style=display:none;> not set to that element */\n    if (!this.is(\":hidden\")) { this.hide(); };\n\n    /* get browser default lang */\n    if (navigator.userLanguage) {\n        baseLang = navigator.userLanguage.substring(0,2).toLowerCase();\n    } else {\n        baseLang = navigator.language.substring(0,2).toLowerCase();\n    }\n    language = $.getUrlParam(\'lg\')\n    /* language match */\n    switch(baseLang){\n        case \"en\":\n            language_dir = \"./english/\";\n            return language_dir\n        case \"zh\":\n            language_dir = \"./chinese/\";\n            return language_dir\n        default:\n    }\n};\n\nfunction getCookie(name){\n  var arr,reg=new RegExp(\"(^| )\"+name+\"=([^;]*)(;|$)\");\n  if(arr=document.cookie.match(reg)){\n    return unescape(arr[2]);\n  }else{\n    return null;\n  }\n}\n\nfunction get_def_language(){\n    language = $.getUrlParam(\'lg\')\n    language_dir = \"./chinese/\";\n\n    old_language = getCookie(\'language\');\n    if(language==\'en\'){\n      old_language=\'en\'\n      document.cookie=\"language=\"+old_language;\n    }else if(language==\'cn\'){\n      old_language=\'cn\'\n      document.cookie=\"language=\"+old_language;\n    }\n\n    if(old_language == null){\n      return $.fn.chk_userlanguage();\n    }\n    if(old_language == \"en\"){\n      language_dir = \"./english/\";\n    }else if(old_language == \"cn\"){\n      language_dir = \"./chinese/\";\n    }\n    return language_dir;\n}\n\nfunction set_language(language){\n  language_dir = \"./chinese/\";\n  old_language = getCookie(\'language\');\n  if(old_language == null || language != old_language){\n    document.cookie=\"language=\"+language;\n    old_language = language;\n  }\n  if(old_language == \"en\"){\n    language_dir = \"./english/\";\n  }\n    window.location.href = window.location.pathname + \'?lang=\' + old_language\n}\n\nfunction getParameterByName(name) {\n  return decodeURIComponent((new RegExp(\'[?|&]\' + name + \'=\' + \'([^&;]+?)(&|#|;|$)\').exec(location.search)||[,\"\"])[1].replace(/\\+/g, \'%20\'))||null;\n}\n\nfunction check_language_parameter() {\n    var lang_param = getParameterByName(\'lang\');\n    if(lang_param != null && (lang_param == \'en\' || lang_param == \'cn\')) {\n        get_def_language();\n        if(old_language != lang_param) {\n            set_language(lang_param);\n        }\n    } else if(lang_param == null) {\n        if(document.referrer.search(\"www.speedycloud.cc\") >= 0) {\n            get_def_language();\n            if(old_language != \'en\') {\n                set_language(\'en\');\n            }\n        }\n    }\n}\n\ncheck_language_parameter();\n\nfunction get_index(){\n    $(\"#content\").load(language_dir + \'/index/index.html\');\n    $.getScript(language_dir + \"index/main.js\");\n}\n\nfunction s3(){\n      $(\"#content\").load(language_dir + \'s3/index.html\');\n      $.getScript(language_dir + \"s3/main.js\");\n}\n\nfunction get_distribution(){\n      $(\"#content\").load(language_dir + \'distribution_data/index.html\');\n      $.getScript(language_dir + \"distribution_data/main.js\");\n}\n\nfunction get_net(){\n      $(\"#content\").load(language_dir + \'net_data/index.html\');\n      $.getScript(language_dir + \"net_data/main.js\");\n}\n\nfunction get_cloud_host(){\n      $(\"#content\").load(language_dir + \'net_data/index.html\');\n      $.getScript(language_dir + \"cloud_host/main.js\");\n}\n\nfunction get_cloud_volumes(){\n      $(\"#content\").load(language_dir + \'net_data/index.html\');\n      $.getScript(language_dir + \"cloud_volumes/main.js\");\n}\n\nfunction get_vod(){\n      $(\"#content\").load(language_dir + \'vod_data/index.html\');\n      $.getScript(language_dir + \"vod_data/main.js\");\n}\n\nfunction get_database(){\n      $(\"#content\").load(language_dir + \'database/index.html\');\n      $.getScript(language_dir + \"database/main.js\");\n}\n\nfunction get_dns(){\n      $(\"#content\").load(language_dir + \'dnsapi/index.html\');\n      $.getScript(language_dir + \"dnsapi/main.js\");\n}\n\nfunction translate_nav(){\n  old_language = getCookie(\'language\');\n  language = $.getUrlParam(\'lg\')\n  if(language==\'en\'){\n    old_language=\'en\'\n  }else if(language==\'cn\'){\n    old_language=\'cn\'\n  }\n  if(old_language == \'en\'){\n    $(\"#index\").html(\"General\")\n    $(\"#host\").html(\"Server\")\n    $(\"#volumes\").html(\"Storage\")\n    $(\"#net\").html(\"Network\")\n    $(\"#distribution\").html(\"Cloud Distribution\")\n    $(\"#vod\").html(\"Media Encoding\")\n    $(\"#login\").html(\"Login\")\n    $(\"#register\").html(\"Register\")\n    $(\"#s3\").html(\"Object Storage\")\n    $(\"#database\").html(\"Cloud Databases\")\n    $(\"#dns\").html(\"DNS\")\n    return true\n  }\n}\n\n</script> \n<script src=\"./static/vendor/require.min.js\"></script',10,'2017-03-14 21:10:42','2017-03-14 21:10:42');
